  \"2013-12-07T09:04:20.344469\",\n\t\"name\": \"baileys-ecoregions\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer is commonly called Baileys
  ecoregions and shows ecosystems of regional extent in the United States, Puerto
  Rico, and the U.S. Virgin Islands. Four levels of detail are included to show a
  hierarchy of ecosystems. The largest ecosystems are domains, which are groups of
  related climates and which are differentiated based on precipitation and temperature.
  Divisions represent the climates within domains and are differentiated based on
  precipitation levels and patterns as well as temperature. Divisions are subdivided
  into provinces, which are differentiated based on vegetation or other natural land
  covers. The finest level of detail is described by subregions, called sections,
  which are subdivisions of provinces based on terrain features. Also identified are
  mountainous areas that exhibit different ecological zones based on elevation.\",\n\t\"license_title\":
